import Scalp from './Components/Scalp';

import { useState } from 'react'

function App() {

    const [isToggleOn, setToggle] = useState(true)
    const [isToggleOnTwo, setToggleTwo] = useState(false)
    const [isToggleOnThree, setToggleThree] = useState(false)
    const [isToggleOnFour, setToggleFour] = useState(false)

   const hanClick = () => {
        setToggle( isToggleOn  ? false : true)
      }

    const hanClickTwo = () => {
      setToggleTwo( isToggleOnTwo  ? false : true)
    }


    const hanClickThree = () => {
      setToggleThree( isToggleOnThree  ? false : true)
    }

    const hanClickFour = () => {
      setToggleFour( isToggleOnFour  ? false : true)
    }


return (

<div className="App">
<div className="Navbar">

<a onClick={hanClick}>Daily</a>
<a onClick={hanClickTwo}>BLX</a>
